The 2nd param `const char* logid` is not passed to the 3rd param `OrtLoggingFunction` log function in constructor
`Env(OrtLoggingLevel logging_level, const char* logid, OrtLoggingFunction logging_function, void* logger_param);`

Instead a pointer to a null string is passed.

### Setup

* Microsoft Windows [Version 10.0.19044.1826]
* VS2019 community v16.11.17
* onnx 1.12.0 via nuget `<package id="Microsoft.ML.OnnxRuntime.DirectML" version="1.12.0" />`

### Repro

Using setup above and pseudo code below, inspect or print to console the logid passed to the custom log function

```c++
Ort::InitApi();
Ort::Env env(
    ORT_LOGGING_LEVEL_WARNING, "mycustomlogger", [](void *param, OrtLoggingLevel severity, const char *category, const char *logid, const char *code_location, const char *message)
    {
        std::cerr << "ort log " << logid << ", " << severity << ", " << category << ", " << code_location << ", " << message << ((intptr_t)param == 3 ? "[valid]" : "[bad]") << std::endl;
    },
    (void*)3);
Ort::SessionOptions session_options;
auto& api = Ort::GetApi();
OrtDmlApi* dmlApi = nullptr;
Ort::ThrowOnError(api.GetExecutionProviderApi("DML", ORT_API_VERSION, (const void**)&dmlApi));
Ort::ThrowOnError(dmlApi->SessionOptionsAppendExecutionProvider_DML(session_options, 0));
Ort::Session session = Ort::Session(env, L"squeezenet1.0-7.onnx", session_options);
```

### Result

The `logid` parameter is pointer to null string.

```
ort log , 2, onnxruntime, inference_session.cc:500 onnxruntime::InferenceSession::RegisterExecutionProvider, Having memory pattern enabled is not supported while using the DML Execution Provider. So disabling it for this session since it uses the DML Execution Provider.[valid]
```

![image](https://user-images.githubusercontent.com/679350/182259457-0c7c95ce-d6ef-48ac-b454-5c049064d190.png)


### Expected

The `logid` parameter is a pointer to string "mycustomlogger"

```
ort log mycustomlogger, 2, onnxruntime, inference_session.cc:500 onnxruntime::InferenceSession::RegisterExecutionProvider, Having memory pattern enabled is not supported while using the DML Execution Provider. So disabling it for this session since it uses the DML Execution Provider.[valid]
```
